import React, { Component } from 'react';
import '../Header.css'
import BarItem from './BarItem';
import Carousel from 'react-bootstrap/Carousel'
import P1 from '../img/about1.jpg'
import P2 from '../img/about3.jpg'
import P3 from '../img/about5.jpg'


class About extends Component {
    render() {
        return (
            <div id="font">
                <BarItem />
                <Carousel >
                    <Carousel.Item>
                        <img className="d-block w-100" src={P1} alt="First slide"/>
                        <h1>Hello</h1>
                    
                    </Carousel.Item>

                    <Carousel.Item>
                        <img
                            className="d-block w-100"
                            src={P2}
                            alt="Third slide"
                        />
                    </Carousel.Item>

                    <Carousel.Item>
                        <img
                            className="d-block w-100"
                            src={P3}
                            alt="Third slide"
                        />
                    </Carousel.Item>

                </Carousel>
            </div>
        );
    }

}
export default About;
